import React,{ Component } from 'react'
import './about.css'
import Header from '../../components/Header'
import Footer from '../../components/Footer'
import Carousel from '../../components/Carousel'

class About extends Component{
    render() {
        return(
            <div id="site-wrapper">
                <Header />
                    <div id="page-content">
                      <Carousel />
                    </div>
                <Footer />
            </div>
        );
    }
}

export default About
